import React, { Component } from 'react';

class Footer extends Component {

	createAlert(){
		alert('You clicked me')
	}
	render () {
		return (
			<React.Fragment>
			<h2 onClick={this.createAlert}> {this.props.trademark} </h2>
			</React.Fragment>
			)
	}

}

export default Footer;
